import React from 'react';
import { connect } from 'react-redux';
class CompletedList extends React.PureComponent {


    render() {
        const { data } = this.props;
        // debugger
        const CompleteItems = (
            data.map(item => {
                    return (
                        <div key={item.id}>
                            <span className="name ">{item.name}</span>
                        </div>
                    )
               
            })
        )

        return (
            <>
                <div className="completedList">
                    <span className="name title">Complete</span>
                    {CompleteItems}
                </div>

            </>

        )

    }
}


const mapStateToProps = state => ({
     data : state.items.filter(item =>{ return item.isCompleted === true})
});


const mapDispatchToProps = dispatch => ({

});


export default connect(mapStateToProps, mapDispatchToProps)(CompletedList);
